import React from 'react';
import { Formik, Form, Field, ErrorMessage } from 'formik';
import * as Yup from 'yup';
import './SignUp.css';

const SignUp = () => {
  const initialValues = {
    name: '',
    email: '',
    password: '',
    organization: '',
    termsAccepted: false,
  };

  const validationSchema = Yup.object().shape({
    name: Yup.string().required('Name is required'),
    email: Yup.string().email('Invalid email').required('Email is required'),
    password: Yup.string().required('Password is required'),
    organization: Yup.string().required('Organization is required'),
    termsAccepted: Yup.boolean().oneOf([true], 'You must accept the terms'),
  });

  const handleSubmit = (values) => {
    // Perform sign-up logic with values
  };

  return (
    <div className="signup-container">
      <h2>Sign Up</h2>
      <Formik
        initialValues={initialValues}
        validationSchema={validationSchema}
        onSubmit={handleSubmit}
      >
        <Form>
          <Field type="text" name="name" placeholder="Name" />
          <ErrorMessage name="name" component="div" className="error-message" />

          {/* Other input fields */}

          <div className="terms">
            <Field type="checkbox" name="termsAccepted" />
            <label htmlFor="termsAccepted">Accept Terms and Conditions</label>
            <ErrorMessage name="termsAccepted" component="div" className="error-message" />
          </div>

          <button type="submit">Register</button>
        </Form>
      </Formik>
      <p>Already have an account? <a href="#">Sign In</a></p>
    </div>
  );
};

export default SignUp;
